    let seed = (Date.now() ^ (Math.random() * 0xFFFFFFFF)) >>> 0;
    function rnd() {
      seed ^= (seed << 13) >>> 0;
      seed ^= (seed >>> 17) >>> 0;
      seed ^= (seed << 5) >>> 0;
      return (seed >>> 0) / 4294967296;
    }
    function rint(a, b) { return a + Math.floor(rnd() * (b - a + 1)); }
    function choice(arr) { return arr[Math.floor(rnd() * arr.length)]; }

    // å»å…¬å…±å·¦ç¼©è¿›ï¼šä¿®å¤ â€œAâ€ ç­‰å­—ç¬¦è´´è¾¹/è¢«è£å‰ªçš„å…¸å‹é—®é¢˜
    function dedent(raw) {
      const lines = raw.replace(/\r/g, "").split("\n");
      let min = Infinity;
      for (const ln of lines) {
        if (!ln.trim()) continue;
        const m = ln.match(/^ +/);
        const n = m ? m[0].length : 0;
        if (n < min) min = n;
      }
      if (!isFinite(min) || min === 0) return lines.join("\n");
      return lines.map(l => l.slice(min)).join("\n");
    }

