    // - æŒ‰ç­‰å®½â€œåˆ—æ•°â€ä¼°ç®—ï¼ˆæŒ‰ Unicode code point è®¡æ•°ï¼›emoji å¯èƒ½å æ›´å®½ä½†ä¸è‡´å‘½ï¼‰
    // - ä¼˜å…ˆåœ¨ç©ºæ ¼å¤„æ–­è¡Œï¼›æ‰¾ä¸åˆ°ç©ºæ ¼å°±ç¡¬åˆ‡
    const WRAP_COLS = 84;

    function expandTabs(s, tabSize=4) {
      return s.replace(/\t/g, " ".repeat(tabSize));
    }

    function wrapLine(line, maxCols) {
      const chars = Array.from(line);
      if (chars.length <= maxCols) return [line];

      const out = [];
      let start = 0;
      while (start < chars.length) {
        const end = Math.min(start + maxCols, chars.length);

        if (end === chars.length) {
          out.push(chars.slice(start).join(""));
          break;
        }

        // åœ¨ [start, end) é‡Œæ‰¾æœ€åä¸€ä¸ªç©ºæ ¼ä½œä¸ºæ–­ç‚¹
        let cut = -1;
        for (let i=end-1; i>start; i--) {
          if (chars[i] === " ") { cut = i; break; }
        }

        if (cut === -1) {
          // æ²¡ç©ºæ ¼ï¼šç¡¬åˆ‡
          out.push(chars.slice(start, end).join(""));
