          out.push(chars.slice(start, cut).join(""));
          start = cut + 1;
        }
      }
      return out;
    }

    function wrapText(text, maxCols) {
      const lines = expandTabs(text).replace(/\r/g, "").split("\n");
      const wrapped = [];
      for (const ln of lines) {
        if (Array.from(ln).length > maxCols) wrapped.push(...wrapLine(ln, maxCols));
        else wrapped.push(ln);
      }
      return wrapped.join("\n");
    }

