    const viewport = document.getElementById("termViewport");
    const outSpan  = document.getElementById("terminalText");

    // --- å†…å®¹ç¼“å†²ï¼ˆç”¨é˜Ÿåˆ—æ–¹ä¾¿è£å‰ªæ—§è¡Œï¼‰---
    let linesBuf = [];
    function appendText(str) {
      // é€å­—ç¬¦è¿½åŠ ç»™æ‰“å­—æœºä½¿ç”¨ï¼ˆè¿™é‡Œåªè´Ÿè´£æœ€ç»ˆè½ç›˜ï¼‰
      const parts = str.replace(/\r/g,"").split("\n");
      // æŠŠå³å°†åŠ å…¥çš„æ–‡æœ¬å…ˆåˆå¹¶åˆ° linesBufï¼ˆä¿æŒè¡Œï¼‰
      if (parts.length === 1) {
        // æ²¡æ¢è¡Œï¼šæ‹¼åˆ°æœ€åä¸€è¡Œ
        if (linesBuf.length === 0) linesBuf.push("");
        linesBuf[linesBuf.length-1] += parts[0];
      } else {
        // æœ‰æ¢è¡Œï¼šç¬¬ä¸€æ®µæ‹¼åˆ°æœ€åä¸€è¡Œï¼Œç„¶å push å…¶å®ƒè¡Œ
        if (linesBuf.length === 0) linesBuf.push("");
        linesBuf[linesBuf.length-1] += parts[0];
        for (let i=1;i<parts.length;i++) linesBuf.push(parts[i]);
      }

      // è£å‰ªæ—§è¡Œï¼Œä¿è¯æ€§èƒ½
      if (linesBuf.length > MAX_LINES_KEEP) {
        linesBuf = linesBuf.slice(linesBuf.length - MAX_LINES_KEEP);
      }

      outSpan.textContent = linesBuf.join("\n");

      // è‡ªåŠ¨æ»šåŠ¨åˆ°åº•éƒ¨
      viewport.scrollTop = viewport.scrollHeight;
    }
    // --- æ‰“å­—æœºï¼ˆæ‰“å°å®Œå°±åœï¼Œåªå‰©å…‰æ ‡é—ªçƒï¼‰---
    let source = "";
    let idx = 0;

    function tick() {
      if (idx >= source.length) return;

      const ch = source[idx++];
      appendText(ch);

      if (ch === "\n") {
        setTimeout(tick, LINE_PAUSE);
      } else {
        setTimeout(tick, rint(TYPE_MIN, TYPE_MAX));
      }
    }

    // --- åˆå§‹åŒ–ï¼šå…ˆæ‰“ bannerï¼ˆå·¦ä¸Šå¯¹é½ + å»ç¼©è¿›ï¼‰ç„¶åè¿›å…¥æ— é™å‘½ä»¤æµ ---
